for i, j in polynom_factor:
    es = Fp(-i.coefficients()[0])
    Spos = discrete_log(es, eb)
    g = y * (2^512) + Spos
    sols = g.monic().small_roots(X=2^512, beta=0.6)
    if sols:
        qr = sols[0] * 2^512 + Spos
        if n % qr == 0:
            print("Dapet")
            break


p_fac = int(n // int(qr))
d = inverse(e, p_fac - 1)
m = pow(c, d, p_fac)
flag = long_to_bytes(int(m))
print(flag)
